  %include "../../defaults_bin.asm"

  ; Determine and print phase
  lockstep 1
  mov ax,cs
  mov es,ax
  mov ds,ax
  mov di,data2

  in al,0x21
  mov [imr],al
  mov al,0xfe  ; Enable IRQ0 (timer), disable all others
  out 0x21,al

  in al,0x61
  or al,3
  out 0x61,al

  mov al,TIMER2 | BOTH | MODE2 | BINARY
  out 0x43,al
  mov dx,0x42
  mov al,0
  out dx,al
  out dx,al

  %rep 5
    readPIT16 2
    stosw
  %endrep

  refreshOn

  mov ax,'0'
  mov di,[data2+8]
  mov si,[data2+6]
  mov bx,[data2+4]
  mov cx,[data2+2]
  mov dx,[data2]
  sub dx,cx
  sub dx,20
  jnz notPhase0
  add ax,1
notPhase0:
  sub cx,bx
  sub cx,20
  jnz notPhase1
  add ax,2
notPhase1:
  sub bx,si
  sub bx,20
  jnz notPhase2
  add ax,4
notPhase2:
  sub si,di
  sub si,20
  jnz notPhase3
  add ax,8
notPhase3:

  sti
  outputCharacter
  mov al,13
  outputCharacter
  cli


  mov ax,0xb800
  mov es,ax
  mov ax,cs
  mov ds,ax
  mov si,data
  xor di,di
  mov cx,8000
  cld
  rep movsw

restart:

  sti
  mov ax,[cs:adjustPeriod]
  outputHex
  mov al,13
  outputCharacter
;  captureScreen
  cli

  lockstep 1
  safeRefreshOn 19

  writePIT16 0, 2, 2
  ; Mode
  ;      1 +HRES
  ;      2 +GRPH
  ;      4 +BW
  ;      8 +VIDEO ENABLE
  ;   0x10 +1BPP
  ;   0x20 +ENABLE BLINK
  mov dx,0x3d8
  mov al,9
  out dx,al

  ; Palette
  ;      1 +OVERSCAN B
  ;      2 +OVERSCAN G
  ;      4 +OVERSCAN R
  ;      8 +OVERSCAN I
  ;   0x10 +BACKGROUND I
  ;   0x20 +COLOR SEL
  inc dx
  mov al,0
  out dx,al

  mov dl,0xd4
  mov ax,0x7100
  out dx,ax
  mov ax,0x2801
  out dx,ax
  mov ax,0x5a02
  out dx,ax
  mov ax,0x0f03
  out dx,ax
  mov ax,0x5604
  out dx,ax
  mov ax,0x0005
  out dx,ax
  mov ax,0x1a06
  out dx,ax
  mov ax,0x3207
  out dx,ax
  mov ax,0x0008
  out dx,ax
  inc ax
  out dx,ax
  mov ax,0x060a
  out dx,ax
  mov ax,0x070b
  out dx,ax
  mov ax,0x000c
  out dx,ax
  inc ax
  out dx,ax
  mov ax,0x3f0e
  out dx,ax
  mov ax,0xff0f
  out dx,ax


  mov dl,0xda
  waitForVerticalSync
  waitForDisplayEnable

  writePIT16 0, 2, 76*261 - 1

  xor ax,ax
  mov ds,ax
  mov word[0x20],interrupt8a
  mov [0x22],cs

  sti
  hlt
interrupt8a:
  in al,dx
  test al,1
  jz .noInterruptChange  ; jump if +DISPEN, finish if -DISPEN
  mov word[0x20],interrupt8b
.noInterruptChange:
  mov al,0x20
  out 0x20,al
  mov sp,stackTop
  sti
  hlt

interrupt8b:
  mov al,0x34                  ; We're still counting down from 19911
  out 0x43,al
  mov ax,[cs:adjustPeriod]
  out 0x40,al
  mov al,ah
  out 0x40,al
  mov word[0x20],interrupt8c
  mov al,0x20
  out 0x20,al
  mov sp,stackTop
  sti
  hlt

interrupt8c:
  writePIT16 0, 2, 76*261       ; We're still counting down from adjustPeriod
  mov word[0x20],interrupt8d
  mov al,0x20
  out 0x20,al
  mov sp,stackTop
  sti
  hlt

interrupt8d:
  writePIT16 0, 2, 76*261       ; We're still counting down from adjustPeriod
  mov word[0x20],interrupt8
  mov al,0x20
  out 0x20,al
  mov sp,stackTop
  sti
  hlt

interrupt8:
;  mov dx,0x3d4
;  mov al,0x0d
;  out dx,al
;  mov al,1
;  mov dl,0xd9
;  out dx,al
;  mov dl,0xd5
;  out dx,al
;  mov al,2
;  out dx,al
;  mov dl,0xd9
;  out dx,al

  mov dx,0x3d4
  mov al,0x04
  out dx,al
  mov al,0x57
  mov dl,0xd9
  out dx,al
  mov dl,0xd5
  out dx,al
  mov al,0x56
  out dx,al
  mov dl,0xd9
  out dx,al

  mov ax,cs
  mov ds,ax

  in al,0x60
  xchg ax,bx
  ; Acknowledge the previous byte
port61high:
  mov al,0xcf
  out 0x61,al
port61low:
  mov al,0x4f
  out 0x61,al
  cmp bl,1
  je tearDown
  cmp bl,0x4b
  je moveLeft
  cmp bl,0x4d
  je moveRight
  cmp bl,0x48
  je moveUp
  cmp bl,0x50
  je moveDown

finishInterrupt:
  mov al,0x20
  out 0x20,al
  mov sp,stackTop
  sti
  hlt

moveLeft:
  dec word[adjustPeriod]
  jmp doneFrame
moveRight:
  inc word[adjustPeriod]
  jmp doneFrame
moveUp:
  sub word[adjustPeriod],76
  jmp doneFrame
moveDown:
  add word[adjustPeriod],76



doneFrame:
  mov al,0x20
  out 0x20,al
  mov sp,stackTop

  writePIT16 0, 2, 0
  xor ax,ax
  mov ds,ax
  mov word[0x20],dummyInterrupt8

  jmp restart


tearDown:
  mov al,0x20
  out 0x20,al
  mov sp,stackTop

  writePIT16 0, 2, 0
  xor ax,ax
  mov ds,ax
  mov word[0x20],dummyInterrupt8

  complete

dummyInterrupt8:
  push ax
  mov al,0x20
  out 0x20,al
  pop ax
  iret



adjustPeriod:
  dw 76*261
imr: db 0

